import React, { useState } from "react";
import styles from "./addUser.module.css";

function AddUser() {
  return (
    <div className>
      <form className="usrform">
        <lb className="lblform">Username</lb>
        <input type="text" className="inpform" />
        <lb className="lblform">Age (years)</lb>
        <input type="number" className="inpform" />
        <button className="btnform">Add</button>
      </form>
    </div>
  );
}

export default AddUser;
